package ejercicios;

public class ej_B {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		//Imprimir los números del 1 al 50, si el número
		//de la iteración actual es divisible por 5, omítelo.
		for(int i=1;i<=50;i++) {
			if(i%5==0) {
				System.out.print("\s"+"");
			}else {
				System.out.print(i);
			}
			
		}
		
	}

}
